internet.self_check_tips:
1. A module abnormality occurs, and the module is not normal after 3 tests. Restart the module. After the module is restarted 5 times, the module is not normal. Restart the system. The system restarts 5 times and it is not normal. Stop testing;
2. If the SIM card is abnormal, the detection is not normal after 3 times, restart the module, and the module is not normal after 5 times of restarts, restart the system, and the system is not normal after 5 times of restarts, stop the detection;
3. The module is not normal after three tests, reset the module, and the module is not normal after resetting the module 3 times, restart the module, and the module is not normal after restarting the module 3 times, restart the system, and the system is not normal after 5 restarts, stop testing;

